INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(23, 'Tips Memilih Makanan Sehat', 3, 'Sering kita temui di pasar maupun swalayan ragam bahan makanan segar dan beku, seperti sayur maupun daging. Jika memilih yang segar, pastikan kondisinya baik dan tidak  rusak ataupun layu.\r\n\r\nPerbedaan bahan makanan segar dengan beku adalah, kandungan gizi makanan segar akan hilang beberapa hari seiring layu atau basi akibat bakteri patogen. Sedangkan makanan beku lebih terjaga  gizinya karena pertumbuhan bakteri patogen dihambat. Makanan beku tidak berarti tidak sehat asalkan jumlah pengawetnya tidak berlebihan hingga membahayakan kesehatan. Perhatikan juga tanggal kedaluwarsanya.\r\n\r\nTiap makanan memiliki  komposisi bahan masing-masing yang bisa bermanfaat bagi tubuh atau malah merugikan. Teliti membaca komposisi makanan bisa membantu Anda mendapatkan manfaat dari isi kandungan di dalamnya. Contohnya, lemak diperlukan tubuh. Namun jika Anda ingin mengurangi lemak, maka kurangi bahan makanan yang mengandung banyak lemak.\r\n\r\nTeknik memasak juga menjadi acuan kesehatan makanan. Teknik memasak bergantung pada selera dan hasil yang diharapkan dalam penyajian makanan. Selain itu, setiap bahan makanan memiliki karakteristik tertentu sehingga  zat gizinya belum tentu bisa bertahan dalam semua cara masak.', , '2020-10-22 07:15:58', '2020-10-25 13:56:10', 14);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(24, 'Tips Olahraga 10 menit', 3, 'Olahraga adalah kunci untuk memiliki bentuk tubuh ideal yang juga bugar. Namun, kendala waktu masih sering menjadi alasan banyak orang untuk melewatkan olahraga. Untuk orang dewasa sehat yang berusia 18-64 tahun, Badan Kesehatan Dunia (WHO) merekomendasikan minimal olahraga aerobik intensitas sedang selama 150 menit per minggu (seperti  jalan cepat dan berenang) atau olahraga aerobik dengan intensitas tinggi, misalnya berlari, selama 75 menit per minggu. Dilansir dari Mayo Clinic, orang dewasa sehat direkomendasikan untuk melakukan latihan kekuatan sekitar 12 sampai 15 pengulangan, minimal setiap dua kali seminggu. Waktu ini bisa dibagi-bagi dengan teratur setiap harinya. Umumnya, lama waktu yang direkomendasikan adalah 30 menit setiap hari atau minimal 3-5 hari dalam seminggu. Batas maksimalnya adalah selama 90 menit setiap hari bagi orang yang kelebihan berat badan (overweight). Terlepas dari lama waktu berolahraga yang direkomendasikan, tidak dapat dipungkiri bahwa kesibukan harian bisa membuat kita mangkir dari sesi olahraga rutin. Nah, jika Anda memang sibuk, luangkanlah waktu 10 menit saja untuk mempraktikkan cara membakar kalori dengan olahraga berikut:\r\n\r\nLatihan kardio dalam 10 menit 1 menit, lakukan jalan cepat atau berbaris di tempat. 1 menit,  lakukan gerakan lengan ke atas dan ke bawah 1 menit, lakukan jumping jack 30 detik, lakukan lompat jauh (melompat ke depan ke belakang) 30 detik, lakukan lari di tempat 30 detik, lakukan lompat jauh 30 detik, lakukan jalan di tempat 30 detik, lakukan burpees (gerakan yang terdiri dari push up, berdiri, lalu melompat dan kembali ke posisi push up) 30 detik, menaiki tangga 30 detik, lakukan jalan di tempat 30 detik, lakukan burpees 30 detik, lakukan jalan di tempat 30 detik, lakukan lari di tempat 1 menit, lakukan squat (gerakan jongkok yang ditahan) 1 menit, lakukan jalan santai di tempat untuk pendinginan', , '2020-10-17 07:21:20', '2020-10-20 07:22:33', 14);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(25, 'Tempat Makan Murah Sekitar Undip', 1, 'Kalian sering bingung saat mencari tempat buat makan? Apalagi di sekitar Tembalang? Eh bentar, kayak pernah denger deh. Tembalang?? Iya,  Tembalang adalah tempat salah satu universitas terbaik di Semarang berdiri, Universitas Diponegoro (Undip).\r\n1. Soak (Sop Iwak) \r\nSoak Sop Iwak \r\nJalan Banjarsari Selatan Nomor 18, Tembalang, Semarang. \r\nSetiap hari, pukul 09.00-21.00 WIB. \r\nPaket 1 (Sop Iwak + Nasi + Es Teh Jumbo) Rp 13.000 | MieTul Rp 11.000\r\n2. Sobek (Sego Bebek) \r\nSobek / Sego Bebek Madura \r\nJalan Banjarsari Selatan Nomor 10, Tembalang, Semarang. \r\nMinggu-Jumat, pukul 11.00-23.00 WIB. \r\nBebek 1/4 ekor Rp 20.000\r\n3. Ayam Bakar Arto Moro\r\nAyam Bakar Arto Moro \r\nJalan Ngesrep Timur V Nomor 45B Tembalang, Semarang. \r\nSetiap hari, pukul 10.00-22.00 WIB. \r\nAyam Bakar Pedas | Manis Rp 30.000 \r\n4. Sumber Bestik Pak Darmo Solo\r\nSumber Bestik Pak Darmo Solo \r\nJalan Ngesrep Timur V Nomor 52 Tembalang, Semarang. \r\nSetiap hari, Pukul 16.00-23.30 WIB. \r\nBestik Campu Rp 34.000 | Nasi Goreng Krukup Rp 26.000\r\n5. Penyet Kuah Timoho\r\nPenyet Kuah Timoho \r\nJalan Timoho Raya Nomor 32, Tembalang, Semarang. \r\nSetiap hari, pukul 16.00-22.00 WIB. \r\nPenyet Kuah Ayam Rp 12.00 | Penyet Kuah Bawal Rp 12.000 \r\n6. Warmindo Motekar \r\nWarmindo Motekar 10 \r\nJalan Banjarsari Raya, Tembalang, Semarang. \r\nSetiap hari, 24 jam. \r\nAyam Bali Rp 10.000 | Es Nutrisari Rp 3.000', , '2020-10-25 09:14:39', '2020-10-25 09:14:39', 15);
