(26, 'Daftar Foto Copy 24 Jam', 1, '1. Fotocopy KENCANA\r\nJl. Tembalang No. 29 Semarang 50275\r\nTelp : 0877 3174 4769\r\n\r\n2. Fotocopy ZEUS Banjarsari\r\nJl. Tembalang No. 29 Semarang 50275\r\nTelp : 0813-2991-4500\r\n\r\n3. Fotocopy QITHMIR Banjarsari\r\nJl. Tembalang No. Semarang 50275\r\nTelp : 085 640000 749\r\n\r\n4. Fotocopy Shanum Iwenisari Banjarsari\r\nJl. Tembalang Gang Iwenisari No.12A &amp;nbsp;Semarang 50275\r\nTelp : 081575785000\r\n\r\n5. Fotocopy Menara Sumurboto Banyumanik\r\nJalan Ngesrep Timur V, Kelurahan Sumurboto, Kecamatan Banyumanik, Sumurboto, Banyumanik, Kota Semarang, Jawa Tengah 50296\r\nTelp : 0812-2722-7168\r\n\r\n6. Fotocopy Sekawan\r\nJl , Tunjung sari , samping mi ayam sakti ,tembalang , semarang\r\nHotline: 085225048248\r\n\r\n7. FotoCopy Duo\r\nJl. Tunjung sari No.104 , tembalang , semarang\r\nHotline 0895399721506', , '2020-10-12 09:28:56', '2020-10-19 14:28:56', 15);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(27, 'Waduk Undip', 4, 'Ada 2 buah waduk di Kota Semarang. Yang paling populer tentu adalah Waduk Jatibarang yang berada di Kecamatan Gunungpati / Mijen. Selain Jatibarang, ada satu lagi waduk, yaitu Waduk Pendidikan Diponegoro atau lebih sering disebut Waduk Undip, karena berada di area kampus Undip, Kecamatan Tembalang, Kota Semarang.\r\n\r\nMulai dibangun pada tahun 2013 dengan dana hibah dari Kementerian Pekerjaan Umum Direktorat Jenderal Sumber Daya Air, waduk dengan luas daerah tangkapan air mencapai 10,24 kilometer persegi memiliki kedalaman sekitar 15 meter dan dapat menampung genangan air normal hingga 13.500 meter kubik.\r\n\r\nLokasi waduk ini dari Patung Kuda terus saja. Sampai di traffic light Jl Sirojudin lurus saja terus dan kurang dari 1 KM jalan lurus, waduk akan terlihat di sebelah kiri.\r\n\r\nDilengkapi dengan Gardu Pandang, Waduk Pendidikan Diponegoro ini bisa dijadikan alternatif tempat rekreasi / refreshing serta tentunya fungsi edukatif untuk kepentingan pendidikan maupun penelitian.', , '2020-10-12 09:32:04', '2020-10-12 09:32:04', 15);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(28, 'Kafe di Sekitar Undip', 1, 'Tempat ngopi dekat kampus sekarang seperti menjadi kebutuhan utama bagi mahasiswa.\r\nTak heran jika kita banyak menemukan tempat ngopi dekat kampus.\r\nSatu di antaranya adalah di kampus Undip Tembalang.\r\nBagi kamu mahasiswa Undip, banyak Tempat Ngopi Dekat Kampus Undip Tembalang yang bisa kamu datangi.\r\nDirangkum TribunTravel dari laman Google Local Guide, berikut Tempat Ngopi Dekat Kampus Undipyang cocok untuk nongkrong sambil mengerjakan tugas.\r\n\r\n1. Anak Panah Kopi Tembalang\r\nAnak Panah Kopi Tembalang jadi Tempat Ngopi Dekat Kampus Undip yang jadi disukai mahasiswa.\r\nMengantongi bintang 4.5 dari 767 reviewer Google Local Guide, Tempat Ngopi Dekat Kampus Undip ini tak pernah sepi.\r\nAnak Panah Kopi Tembalang berada di Jalan Banjarsari Selatan, No.48 dan buka setiap hari 24 jam.\r\nAnak Panah Kopi Tembalang tak hanya menyajikan aneka racikan kopi, tetapi juga camilan dan hidangan manis yang lezat.\r\n\r\n2. Antara Kata Coffe Talk\r\nAntara Kata Coffe Talk merupakan Tempat Ngopi Dekat Kampus Undip yang jadi tempat nongkrong favorit mahasiswa.\r\nMenghadirkan suasana yang nyaman dan WiFi yang stabil, Antara Kata Coffe Talk juga cocok untuk menikmati segelas kopi sambil mengerjakan tugas.\r\nAntara Kata Coffe Talk termasuk Tempat Ngopi Dekat Kampus Undip yang buka 24 jam, lho.\r\nLokasi Antara Kata Coffe Talk ada di Jalan Durian Raya No.65 Banyumanik, Semarang.\r\nSelain Kopi, Antara Kata Coffe Talk juga menyediakan menu makanan ringan dan makanan berat mulai dari sandwich, katsu, chicken blackpapper dan masih banyak lagi.\r\n\r\n3. Jendela Coffee Brewers &amp; Kitchen\r\nTempat ngopi dekat kampus Undip selanjutnya adalah Jendela Coffee Brewers &amp; Kitchen yang berlokasi di Jalan Banjarsari Selatan No.51, Banyumanik.\r\nJendela Coffee Brewers &amp; Kitchen menyediakan ruangan ber-AC, outdoor dan smooking room terpisah.\r\nSelain kopi, Jendela Coffee Brewers &amp; Kitchen juga menyajikan menu makanan western enak harga pas di kantong mahasiswa.\r\nJendela Coffee Brewers &amp; Kitchen merupakan Tempat Ngopi Dekat Kampus Undip yang cocok buat nongkrong sambil skripsian.\r\n\r\n4. Kopi Benteng\r\nKopi Benteng merupakan Tempat Ngopi Dekat Kampus Undip yang terkenal di kalangan mahasiswa karena kelezatan cokelat panasnya.\r\nCokelat panas kental ala Kopi Bentang memang belum ada tandingannya.\r\nBerlokasi di Taman Kuliner Turki Jalan Tusam Raya, Kopi Benteng buka dari pukul 11.00 hingga pukul 00.00.\r\nSelain cokelat panas, Kopi Benteng menyediakan menu aneka minuman kopi dan camilan pendamping ngopi.\r\nKopi Benteng sering dijadikan tempat untuk nongkrong hingga nobar (nonton bareng) pertandingan sepakbola.\r\n\r\n5. Stove Syndicate Coffee &amp; Waffle\r\nStove Syndicate Coffee &amp; Waffle di Jalan Ngesrep Timur V Sumurboto, Banyumanik ini merupakan Tempat Ngopi Dekat Kampus Undip yang jadi favorit mahasiswa.\r\nDibanding 4 Tempat Ngopi Dekat Kampus Undip yang dibahas di atas, Stove Syndicate Coffee &amp; Waffle merupakan yang sudah ada sejak lama.\r\nTempatnya yang nyaman dan WiFi stabil membuat tamu betah berlama-lama nongkrong di Stove Syndicate Coffee &amp; Waffle.\r\nSuasananya tenang sehingga cocok unutk mengerjakan tugas, rapat atau skripsian.\r\nSesuai namanya, Stove Syndicate Coffee &amp; Waffle juga menyajikan aneka menu waffle.\r\nSelain kopi dan waffle, Stove Syndicate Coffee &amp; Waffle juga menyediakan menu makanan western yang lezat.', , '2020-10-23 09:35:41', '2020-10-23 09:35:41', 15);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(29, 'Undip Inn', 2, 'Hotel Undip Inn adalah fasilitas di Universitas Diponegoro yang terletak di Gedung Training Centre II (TCII). Bangunan tersebut memiliki luas 3.000 m2 dengan tinggi 8 lantai. Lantai pertama adalah lobby dan fasilitas umum, lantai dua adalah ruang pengelola dan ruang pelatihan, lantai 3 hingga 7 adalah fasilitas penginapan dengan jumlah kamar ada 50 sekelas dengan fasilitas kamar hotel bintang tiga, serta lantai 8 adalah ruang convention dan ruang penunjang. Fasilitas ini untuk memfasilitasi dan mengakomodasi kegiatan seperti pelatihan atau seminar yang ada di Undip, dan terbuka untuk umum.\r\n\r\nAlamat : Jalan Prof Soedharto, Tembalang, Tembalang, Semarang, Jawa Tengah, Indonesia, 50275', , '2020-10-22 09:39:25', '2020-10-25 14:03:35', 15);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(30, 'Tempat Jogging Terbaik di Tembalang', 3, 'Akhir-akhir ini tren berolahraga makin meningkat karena dampak dari adanya pandemi Covid-19, terutama jogging dan bersepeda. Kesadaran akan kesehatan tampaknya menjadi salah satu hikmah dari adanya wabah ini. Jogging memang dikenal sebagai kegiatan yang murah dan sederhana. Kanca Tembalang hanya perlu menggunakan celana training yang ada di lemarimu, kaos, dan juga sepatu yang biasa digunakan.\r\n\r\nMaka dari itu, jogging bisa menjadi pilihan untukmu yang ingin tetap sehat selama masa karantina. Nah, untuk Kanca Tembalang yang ingin memulai jogging, beberapa rekomendasi tempat ini bisa dijadikan referensi untuk jogging, lho. Berikut daftarnya.\r\n\r\n1. Stadion Undip\r\nUniversitas terkemuka di Tembalang, yaitu Universitas Diponegoro (Undip), sudah menyediakan tempat yang menunjang untuk jogging, yakni di Stadion Undip. Terlebih lagi, di Stadion Undip juga sudah dilengkapi dengan fasilitas running track. Alhasil, jogging akan terasa lebih nyaman.\r\n\r\n2. Waduk Pendidikan Undip\r\nWaduk ini letaknya tepat berada di sebelah utara stadion. Kanca Tembalang bisa jalan kaki untuk sampai ke sini. Walaupun fungsi utamanya sebagai penampungan air, tempat ini juga dijadikan sebagai alternatif tempat rekreasi atau refreshing. Beberapa kali juga terlihat warga sekitar melakukan aktivitas memancing di waduk. Untuk Kanca Tembalang yang mau jogging, bisa dilakukan di jalanan aspal samping waduk.\r\n \r\n3. Widya Puraya\r\nSpot yang satu ini bisa ditemui di area kampus Universitas Diponegoro (Undip) tepatnya di depan gedung rektorat. Lapangan dengan luas yang cukup untuk upacara atau perayaan-perayaan penting ini juga biasa digunakan untuk jogging. Lapangan Widya Puraya ini memilik banyak pepohonan rindang yang ada di samping lapangan. Tentunya, akan membuat suasana hatimu menjadi lebih happy.\r\n\r\n4. Lapangan Tembak Kodam IV\r\nLapangan Tembak Kodam IV ini biasa dikenal dengan Lapangan Tembak Undip karena letaknya yang berada di area kampus Undip. Meski biasa digunakan latihan militer para tentara, namun lapangan tembak ini juga dibuka untuk umum. Sehingga, tak jarang jika sering dijumpai para pengunjung melakukan aktivitas olahraga, seperti jogging. Lapangan ini cocok untuk Kanca Tembalang yang meyukai suasana sunyi dan asri. Letaknya yang berada di komplek tentara, membuat suasana lapangan menjadi lebih tenang dan tak lupa dipenuhi oleh hijaunya pepohonan.\r\n\r\nKanca Tembalang bisa memanfaatkan apa saja yang ada di lingkungan sekitar untuk membantu tubuh tetap bugar. Jika diperlukan, kamu juga bisa menyiapkan playlist lagu favoritmu untuk menambah semangatmu dalam berolahraga. Tetap jaga kesehatan, ya!', , '2020-10-14 09:44:06', '2020-10-14 09:44:06', 15);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(31, 'STADION UNDIP', 2, 'Universitas Diponegoro (Undip) memiliki stadion sepakbola kebanggaan yang berada di kompleks gelora Kampus Undip Tembalang. Stadion Utama Kampus Undip Tembalang ini hampir mirip seperti stadion yang dimiliki oleh kebanyakan klub-klub di Indonesia. Ada tribun utama di kedua sisi yang mampu menampung ribuan penonton.\r\n\r\nStadion Utama Kampus Undip Tembalang, Semarang kini tampak lebih futuristik usai dilakukan renovasi pada pergantian tahun 2015 lalu. Bagian eksterior dari arah pintu masuk stadion kini tampak lebih elegan dengan tambahan logo Undip ditengah-tengahnya. Begitu pula bagian interior stadion. Tampak lebih rapi.		\r\n\r\nTerletak di ujung timur wilayah territorial kampus, stadion ini menjadi pusat berbagai macam olahraga dan jika di akhir pekan biasanya banyak yang menggunakan untuk lari pagi. Tak hanya olahraga, tempat ini juga menjadi venue berlangsungnya moment penting tiap tahunnya, yakni Upacara Penerimaan Mahasiswa Baru (PMB) dan Orientasi Diponegoro Muda (ODM).', , '2020-10-14 17:08:41', '2020-10-25 14:00:18', 17);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(33, 'RSND', 2, 'Rumah Sakit Nasional Diponegoro (National Diponegoro Hospital) merupakan Rumah Sakit Perguruan Tinggi Negeri milik Universitas Diponegoro Semarang yang merupakan Rumah Sakit tipe C dan terakreditasi KARS, namun memiliki karakteristik seperti Rumah Sakit tipe B karena didukung oleh fasilitas, peralatan yang canggih serta tenaga medis yang berkualitas dan terlatih. Rumah Sakit Nasional Diponegoro saat ini memiliki lebih dari 100 orang dokter yang terdiri dari dokter umum, dokter gigi, dokter spesialis juga konsultan. Memiliki 19 klinik rawat jalan dan mengoperasikan 100 tempat tidur dari total 300 tempat tidur yang dimiliki. Melayani gawat darurat, rawat inap, ICU, klinik rawat jalan, apotek, radiologi, laboratorium, rehabilitasi medik, kateterisasi jantung, cuci darah serta Ambulans 24 Jam. Terletak di kampus Universitas Diponegoro, kecamatan Tembalang Semarang.\r\n\r\nRSND diharapkan dapat melayani mahasiswa, dosen, tenaga kependidikan Universitas Diponegoro dan warga sekitar yaitu warga kecamatan Tembalang, Semarang Selatan dan Semarang Timur, juga daerah kabupaten sekitarnya seperti Kabupaten Semarang, Demak dan Kendal dalam waktu dekat. Selanjutnya diharapkan menjadi Rumah Sakit yang menjadi pusat rujukan di Jawa Tengah dan berkembang menjadi skala Nasional yang memberikan pelayanan kesehatan terpadu dan bermutu dengan mengutamakan aspek pendidikan berbasis riset. Selain itu juga menyelenggarakan pelayanan kesehatan paripurna, riset klinik dan non klinik serta melaksanakan pengabdian pada masyarakat.', , '2020-10-11 13:23:45', '2020-10-12 22:24:37', 17);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(34, 'Jembatan Sikatak', 4, 'Jembatan Sikatak, penghubung di kompleks kampus Universitas Diponegoro (Undip) Semarang tersebut resmi dipergunakan. Jembatan ini menelan biaya pembangunannya senilai Rp22,2 miliar.\r\n\r\nRektor Universitas Diponegoro (Undip) Semarang Yos Johan Utama mengatakan, dengan jembatan tersebut, semua kampus di Undip sudah terhubung. Jembatan yang terbentang di atas Sungai Sikatak tersebut merupakan bagian yang menghubungkan jalur lingkar luar kawasan kampus Undip.\r\n\r\nNama Sikatak didapat dari masyarakat sekitar yang menyebut sikethok (terpotong) yakni jalan yang terpotong oleh kali atau sungai Krengseng. Kini jalan itu tak lagi terpotong.\r\n\r\nAdanya jembatan Sikatak diharapkan semakin memudahkan akses jalan bagi masyarakat sekitar. Masyarakat yang tinggal di Jurang Belimbing, Permata hijau, Sekip dan sekitarnya cukup lewat jalan lingkar tanpa harus memutar atau melewati pintu gerbang kampus. Akses menuju Rumah Sakit Nasional Diponegoro (RSND) kini menjadi lebih cepat dan lancar.', , '2020-10-11 10:29:40', '2020-10-25 13:59:45', 17);
