(36, 'Tips Memilih Kost', 1, 'Hidup mandiri dimulai ketika kamu nge-kost atau ngontrak. Bukan hanya uang dan makanan tapi kamu juga harus menghadapi masalah tempat tinggal. Apalagi yang baru saja mulai nge-kost, pasti di awal kamu merasa kebingungan ketika harus memilih kost. Ya, memang sih memilih kost-kostan itu gampang-gampang susah.\r\nWalaupun pilihannya beragam mulai dari yang harganya mahal sampai murah. Sebenarnya banyak yang harus kamu perhatikan bukan hanya masalah harga. Fasilitas bahkan ukuran kamar pun harus jadi bahan pertimbangan. Khusus buatmu yang baru pertama kali ngekost berikut adalah tips memilih kost yang wajib kamu ketahui.\r\nHidup mandiri dimulai ketika kamu nge-kost atau ngontrak. Bukan hanya uang dan makanan tapi kamu juga harus menghadapi masalah tempat tingal. Apalagi yang baru saja mulai nge-kost. Cari kost an gampang gampang susah. Kost an menjamur di semua area dekat kampus. Pilihan banyak tapi belum tentu sesuai selera. Tidak cuma harga, fasilitas bahkan ukuran kamar pun beragam. Nah sebelas hal di bawah ini bisa jadi bahan pertimbangan kamu nanti ketika mencari kost.\r\n\r\nBudget dan Harga Kamar  Kost\r\nTips memilih kost yang pertama ini yang akan menentuan tempat kostan seperti apa yang akan kamu huni. Harga kamar kost sangat beragam. Lokasi, ukuran dan fasilitas kamar menjadi faktor penentu harga kamar. Makanya putuskan dulu budget kamu sebelum mencari kost. Dengan perkiraan budget, kamu juga bisa memperkecil pilihan kamar nantinya. Jadi tidak perlu repot-repot mengitari banyak kost an.\r\nSebagai contoh kalau kamu ingin harga kamar yang murah. Carilah di lokasi yang agak jauh dari kampus. Atau kamu juga bisa mencari kamar yang tidak memiliki fasilitas AC. Jangan lupa tanyakan uang jaminan atau deposit untuk kamar tersebut. Biasanya uang jaminan sama dengan harga kamar tersebut. Pastikan juga ada tidaknya tambahan biaya. Seperti biaya listrik atau internet yang kadang tidak gratis.\r\n\r\nUkuran Kamar\r\nUkuran kamar berpengaruh besar pada harga kamar. Apalagi bila kalian ingin kamar yang luas. Maka bersiaplah mengeluarkan kocek yang besar. Ukuran kamar sendiri sangatlah beragam. Dari yang hanya bisa ditempati satu orang. Hingga yang bisa ditempati empat orang.  Pastikan terlebih dahulu seberapa besar kamar yang kamu butuhkan. Buat perkiraan juga akan barang-barang yang akan kalian bawa. Apakah cukup pada kamar dengan ukuran kecil atau tidak.\r\n\r\nPencahayaan dan Ventilasi\r\nBagi para pemula! Jangan kaget bila terdapat kost yang gelap dan tidak berventilasi. Hal ini sangatlah lumrah. Lorong kost juga bisa sempit dan tidak berlampu. Tentu saja beberapa kost juga menyediakan lorong yang luas. Agar kamu dapat menaruh barang di lorong tersebut. Tetapi yang terpenting apakah kamar kamu mendapat pencahayaan atau ventilasi.\r\nKarena kalau tidak, kamu akan mendapati jamur plus bau lembap pada kamar kamu. Ventilasi yang disediakan pun terdapat beberapa jenis. Satu dengan hexos yang sekarang banyak dipasang pada kamar. Dua dengan jendela. Tetapi banyak juga kamar yang tidak memiliki jendela. Jadi jangan kaget ketika kamu mendapati kamar seperti itu\r\n\r\nKamar Mandi\r\nTips memilih kamar kost yang nggak kalah penting adalah soal kamar mandi. Kamar dengan kamar mandi dalam akan lebih mahal dari yang tidak. Enaknya! kamu memiliki kamar mandi sendiri. Namun tidak enaknya! kamu harus membersihkan kamar mandi itu sendiri. Belum lagi, kalau terdapat cacing atau kecoa yang sering muncul pada kamar mandi kamu. Tentu saja terdapat pilihan kamar mandi luar juga. Enaknya kamu tidak perlu repot membersihkannya. Hanya saja kamu mungkin harus mengantri untuk dapat masuk ke dalam kamar mandi.\r\n\r\nPerabotan Kost\r\nHampir semua kamar disediakan perabotan untuk penyewanya. Sebagai contoh kasur, meja, kursi dan lemari. Tetapi perabot yang disediakan bisa saja berukuran mini.  Yang tidak sesuai dengan expetasi kalian. Terkadang tidak semua perabot di atas disediakan. Ada yang menawarkan kasur dan lemari saja. Ada pula yang kasurnya saja. Makanya jangan lupa mengecek keadaaan perabotan ketika mencari kamar.\r\nFasilitas Pendingin Ruangan\r\nKalau kamu punya budget yang mepet tips memilih kost ini akan berguna untukmu. Kamu bisa mencari kost-kostan yang tidak menggunakan pendingin ruangan alias AC. Biasanya kamar kost tanpa AC ini harganya jauh lebih murah, apalagi kalau kamu harus ngekost di tempat yang dingin seperti Bandung. Solusi lain untuk kamu yang irit budget tapi tetap ingin kamar kost adem bisa mencoba memasang kipas angin.\r\n\r\nFasilitas Internet\r\nBuat anak perkuliahan internet sangatlah penting. Apalagi kamu yang kuliah dengan menggunakan internet sebagai bahan kuliahnya. Makanya memilih kamar dengan fasilitas ini sangatlah penting. Kalau tidak maka kamu bisa memasang sendiri. Atau terpaksa mencari internet gratis. Sebagai contoh di tempat teman, di beberapa gerai makanan maupun area kampus.\r\n\r\nFasilitas Cuci\r\nJangan diremehkan! Kalau tidak disediakan fasilitas cuci. Maka kalian akan kewalahan mencuci baju sendiri atau bahkan terpaksa berlangganan dengan laundry setempat. Kalau kamu bertanya pada anak kost lain, tips memilih kost yang satu ini pasti jadi bahan pertimbangkan yang paling dipikirkan. Biasanya pihak kost akan mencuci baju sebanyak 2 setel perhari. Yang berarti empat lembar baju. Buat yang suka gonta ganti pakaian harus mikir ulang nih. Rela nggak keluar uang untuk laundry. Yang sekarang di banderol dengan harga minimal 6000/kg di daerah Jakarta.\r\n\r\nFasilitas Parkir\r\nTerkadang fasilitas parkir tidaklah gratis. Maka kalau membawa kendaraan! Pastikan tidak ada biaya tambahan untuk fasilitas tersebut. Apalagi kalau membawa mobil. Mencari kost an yang menyediakan parkir bagi kendaraaan beroda empat ini tidaklah mudah.  Kamu mungkin terpaksa membayar parkir di kost an lain. Atau bahkan membayar pada area parkir umum di sekitar kampus.\r\nFasilitas Dapur\r\nTidak semua kost an menyediakan fasilitas ini. Bahkan tidak semua menyediakan kulkas. Bagi kalian yang ingin menghemat pengeluaran makanan. Maka carilah yang menyediakan fasilitas ini ya. Kalau tidak repot juga kalau harus membawa kompor portable dari rumah.\r\n\r\nAturan Kost\r\nSetiap kost memiliki aturannya sendiri. Dari tanggal bayar dan cara pembayaran kamar. Jam malam untuk tamu . Hingga aturan menginap. Banyak yang tidak memberikan teman kamu menginap di kamar kamu. Bisa juga adanya biaya untuk teman kamu yang menginap. Makanya jangan lupa menanyakan aturan kost ya!\r\n\r\nNah bagaimana? Sudah mulai terbayang fasilitas apa saja yang kalian butuhkan untuk tempat tinggal kamu. Jangan lupa melihat keadaan sekeliling juga ya. Bagi yang suka makan di malam hari. Carilah yang dengan dengan warmindo yang buka 24 jam.  Semoga tips memilih kostan dapat membantu dan selamat mencari ya!', , '2020-10-14 11:19:59', '2020-10-15 11:19:59', 16);
