(38, 'Fakultas di Undip dan Jurusannya', 2, 'Fakultas Kedokteran\r\nPendidikan Dokter\r\nKeperawatan\r\nGizi\r\n\r\nFakultas Teknik\r\nTeknik Sipil\r\nTeknik Arsitektur\r\nTeknik Kimia\r\nTeknik Perancangan Wilayah dan Kota\r\nTeknik Mesin\r\nTeknik Elektro\r\nTeknik Perkapalan\r\nTeknik Industri\r\nTeknik Lingkungan\r\nTeknik Geologi\r\nTeknik Geodesi\r\nSistem Komputer\r\n\r\nFakultas Perikanan dan Ilmu Kelautan\r\nManajemen Sumber Daya Perairan\r\nBudidaya Perairan\r\nPemanfaatan Sumber Daya Perikanan\r\nIlmu Kelautan\r\nOceanografi\r\nTeknologi Hasil Perikanan\r\n\r\nFakultas Sains dan Matematika\r\nMatematika\r\nBiologi\r\nKimia\r\nFisika\r\nStatistika\r\nInformatika\r\n\r\nFakultas Ekonomika dan Bisnis\r\nManajemen\r\nIlmu Ekonomi dan Studi Pembangunan (IESP)\r\nAkuntansi\r\nEkonomi Islam\r\n\r\nFakultas  Peternakan dan Pertanian\r\nPeternakan\r\nAgribisnis\r\nTeknologi Pangan\r\nAgroteknologi\r\n\r\nFakultas Hukum\r\nIlmu Hukum\r\n\r\nFakultas Ilmu Budaya\r\nSastra Indonesia\r\nSastra Inggris\r\nIlmu Sejarah\r\nIlmu Perpustakaan\r\nSastra Jepang\r\nAntropologi\r\n\r\nFakultas Ilmu Sosial dan Ilmu Politik\r\nIlmu Administrasi Publik\r\nIlmu Pemerintahan\r\nIlmu Komunikasi\r\nIlmu Administrasi Bisnis\r\nHubungan Internasional\r\n\r\nFakultas Kesehatan Masyarakat\r\nIlmu Kesehatan Masyarakat\r\n\r\nFakultas Psikologi\r\nPsikologi', , '2020-10-19 11:36:25', '2020-10-19 11:36:25', 16);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(39, 'Tips Menjaga Daya Tahan Tubuh Selama Pandemi', 3, '1. Hindari stres\r\nJangan sampai pemberitaan virus corona maupun konten-konten di media sosial menyebabkan kamu stres terus menerus. Stres menyebabkan peningkatan hormon kortisol yang dapat menurunkan fungsi kekebalan tubuh.\r\nOrganisasi Kesehatan Dunia (WHO) menyarankan agar masyarakat membaca informasi yang kredibel terkait COVID-19, seperti situs pemerintah Covid19.co.id atau di situs WHO. Batasi juga waktu bermain di media sosial, karena banyak konten hoax terkait virus corona.\r\n\r\n2. Istirahat cukup\r\nKekurangan jam tidur menyebabkan letih dan lesu sehingga daya tahan melemah. Namun tidur yang berlebihan juga menyebabkan badan kurang gerak dan mengurangi daya tahan tubuh.\r\nKunci memiliki jam istirahat yang cukup adalah pada kuantitas dan kualitas. Orang dewasa membutuhkan waktu istirahat selama 7-8 jam per hari, remaja dan anak-anak 9-10 jam.\r\n\r\n3. Stop merokok dan alkohol\r\nHentikan kebiasaanmu merokok sekarang juga untuk mengurangi potensi infeksi virus corona. Karena merokok bisa menyebabkan infeksi paru-paru seperti bronkhitis dan pneumonia. Nah, virus corona juga menyerang saluran pernafasan.\r\nSedangkan konsumsi alkohol menurunkan daya tahan tubuh. Orang yang dalam pengaruh alkohol memiliki konsentrasi dan imunitas yang rendah.\r\n\r\n4. Menjalankan pola hidup sehat\r\nMemiliki pola hidup dengan olah raga secara teratur sangat penting bagi kesehatan tubuh. Olah raga mempercepat kerja jantung dan memperlancar aliran darah sehingga bisa membakar lemak dalam tubuh sehingga daya tahan meningkat.\r\nManusia hanya membutuhkan olah raga minimal 150 menit setiap minggu. Lakukan olah raga secara teratur setiap hari atau dua hari sekali, jangan seminggu sekali.\r\n\r\n5. Konsumsi bahan makanan peningkat kekebalan tubuh\r\nKonsumsi vitamin dan suplemen bisa menjaga kesehatan dan meningkatkan daya tahan tubuh terhadap penyakit. Namun kamu lebih baik mendapatkan vitamin dari sumbernya langsung daripada konsumsi vitamin olahan berbentuk tablet, pil atau minuman.\r\nSeperti vitamin C yang berguna untuk daya tahan tubuh, bisa didapatkan dari buah jeruk dan strawberi, serta sayur bayam, paprika merah, dan brokoli. Vitamin A juga bisa meningkatkan kekebalan tubuh serta mengandung antioksidan untuk menangkal radikal bebas bisa didapatkan dari wortel, labu kuning, dan ubi.\r\nKamu juga perlu minum-minuman yang mengandung ekstrak empon-empon seperti jahe merah, kunyit, dan temulawak. Jahe merah mampu menjaga tubuh tetap hangat dan menghambat bakteri penurun imunitas.\r\nKunyit bisa mencegah kehilangan nafsu makan, diare, perut kembung. Sedangkan temulawak mengandung zat kurkumin sebagai antiinflamasi yang menghambat peradangan, seperti di tenggorakan. Perlu diketahui, sebelum virus corona menyerang saluran nafas, virus akan bertahan di tenggorakan hingga hari keempat-kelima.\r\n\r\n6. Jaga suhu tubuh tetap hangat\r\nJangan berlama-lama berada di suhu yang dingin. Karena saat tubuh kedinginan, daya tahan tubuh menurun, sehingga virus mudah menyerang.\r\nDalam kondisi saat ini, jangan biarkan dirimu kehujanan atau mandi di malam hari tanpa menggunakan air hangat. Lalu gunakan pakaian tebal atau jaket saat berada di ruang yang dingin.\r\n\r\n7. Jangan dehidrasi\r\nLebih dari 60% tubuh terdiri dari air. Menurut WHO, kebutuhan air minum orang dewasa rata-rata sekitar 8 gelas atau 2 liter. Anda harus memperbanyak minum air jika melakukan aktivitas berlebih seperti olah raga atau ketika cuaca panas. Kekurangan minum menyebabkan dehidrasi. Saat dehidrasi, tubuh lebih cepat lelah, daya tahan melemah, dan paparan virus bisa mudah menginfeksi.', , '2020-10-17 08:40:34', '2020-10-25 14:13:53', 16);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(41, 'Rusunawa', 2, 'Rumah susun sederhana sewa Undip atau singkatnya Rusunawa Undip merupakan salah satu tempat tinggal bagi mahasiswa Universitas Diponegoro terkhusus anak rantauan. Selain terjangkau, rusunawa juga menyediakan berbagai fasilitas yang dirasa mampu menunjang kehidupan para mahasiswa. Rumah susun kerap diidentikkan dengan kotor ataupun berhantu. Namun, rusunawa undip jauh dari rumor jelek tentang rumah susun tersebut. Bagaimana tidak? Bangunan rusunawa memiliki warna yang sangat cerah, yakni kuning dan pink. \r\nRusunawa Undip memiliki 5 gedung, yaitu gedung A. B, C, D, dan yang terbaru gedung E. Gedung A dan B untuk putra, sedangkan gedung C, D, E untuk putri. Tiap kamar memiliki fasilitas yang sama, diantaranya 2 buah ranjang dan kasur, bantal, seprei, 2 buah lemari + meja belajar, kursi, free air dan listrik, set dapur mini, dan kamar mandi dalam untuk seluruh gedung kecuali gedung A. Tiap gedung juga memiliki Wifi dan corner berkumpulnya para mahasiswa yang biasanya ingin mengerjakan tugas bersama.\r\nGedung A yang berwarna kuning yang terletak di sisi kiri pos satpam. Gedung ini memiliki 5 lantai dan terdiri dari 30an lebih kamar. Setiap kamar idealnya dihuni oleh dua orang mahasiswa. Gedung A tidak memiliki kamar mandi dalam sehingga jika ingin mandi harus turun ke kamar mandi umum di tiap lantai 1. Oleh karena itu harga sewa yang ditawarkan jugalebih murah dari gedung lainnya, yakni Rp. 600.000/kamar. Gedung ini juga disertai balkon dan ruang pengurus rusunawa di lantai dasar.\r\nGedung B memiliki warna yang sama dengan gedung A, terletak persis di belakang gedung A. Memiliki fasilitas tambahan  untuk semua penghuni rusunawa, yaitu terdapat musholla, UKS kantin rusunawa yang menjual berbagai macam masakan padang dan aneka minuman yang harganya pas dikanting mahasiswa. Gedung B memiliki 4 lantai.Untuk harga sewa Gedung B yang ditawarkan adalah Rp. 700.000/kamar.\r\nGedung C terletak di sisi kanan pos satpam, Gedung putri yang memiliki fasilitas yang sama dengan gedung yang lain, seperti Wifi, corner, dan terdiri dari 4 lantai. Diujung lantai biasanya terdapat ruangan VIP untuk tamu yang ingin menginap harian,  tentunya memliki fasilitas yang lebih mewah dan harga sewa yang ditawarkan pun juga lebih mahal.\r\nGedung D terletak persis di belakang gedung C. Gedung D memiliki fasilitas yang sama dengan gedung lainnya dan terhubung dengan parkiran motor utama.\r\nSelain itu, rusunawa juga memiliki pengolahan air limbah yang berlokasi di sisi kiri gedung D\r\nGedung E adalah gedung yang paling terbaru dibangun dan memiliki letak memisah dengan gedung lainnya. Secara look, gedung E paling bagus dan memiliki fasilitas yang paling lengkap, seperti wifi yang menggunakan &quot;undipconnect&quot; dan lantai yang sudah dilapisi keramik. Oleh karena itu harga yang ditawarkan juga bervariasi, Dimulai dari lantai 1 yang termahal yakni Rp. 1000.000/kamar , disusul lantai 2 Rp. 900000 sampai lantai ke-4 Rp. 700.000. Dari gedung E kita juga bisa melihat hamparan stadion dari atas.', , '2020-10-18 11:54:00', '2020-10-19 11:54:00', 16);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(42, 'Widya Puraya', 2, 'Universitas Diponegoro yang terletak di kota Semarang ini terbagi menjadi dua wilayah, yaitu Tembalang dan Pleburan. Untuk para mahasiswa S1 tentu saja lebih akrab dengan kampus Tembalang karena kampus Pleburan ditujukan untuk mahasiswa program S2.\r\n\r\nTembalang kini menjelma jadi kota kecil di dalam kota Semarang itu sendiri. Semua ada di Tembalang, meski mall dan bioskop belum ada. Eh, tapi jangan ding! Belum ada dua bangunan itu saja sudah sering macet, apalagi kalau diadakan.\r\n\r\nTidak usah mahasiswa Undip, masyarakat di sekitar Undip pun pasti tahu gedung yang satu ini. Gedung Widya Puraya yang menjadi ikon Undip ini dibangun pada di akhir 1970-an saat Kampus Tembalang sedang dibangun. Gedung yang akrab disebut WP ini memiliki halaman yang sangat luas dengan lapangan berrumput yang biasa digunakan untuk upacara atau perayaan-perayaan penting.\r\n\r\nWP ini dibangun di atas permukaan tanah yang paling tinggi dibanding gedung-gedung Undip lainnya. Dari gerbang masuk saja, saat mulai melewati jalan tanjakan, atap WP sudah menyambut dengan megahnya. Nah, karena halamannya yang luas ini, banyak mahasiswa yang sering melakukan kumpul-kumpul atau rapat dengan jumlah peserta besar.\r\n\r\nBiasanya para maba alias dedek-dedek mahasiswa baru menjadikan WP sebagai tempat kumpul angkatan karena luas dan mudah dijangkau. Semua sopir angkot pun tahu saat kamu bilang, &quot;Pak, turun WP, ya!,&quot;.', , '2020-10-24 11:54:54', '2020-10-24 11:54:54', 17);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(43, 'UKM di Undip', 5, 'KMHD\r\nKeluarga Mahasiswa Hindu Dharma (KMHD) Universitas Diponegoro, sesuai namanya, adalah UKM yang cocok bagi Quipperian yang beragama Hindu. Di KMHD ini, Quipperian bisa mengenal para mahasiswa yang seagama dengan Quipperian. Didirikannya KMHD bertujuan untuk membangun wadah saling berbagi, melayani, dan membina Sradha dan Bhakti antarmahasiswa yang beragama Hindu di Universitas Diponegoro.\r\n\r\nSelain itu, UKM ini bisa menjadi media dan sarana untuk saling berinteraksi dan berdinamika serta mengembangkan iman dalam diri para mahasiswa Hindu. Tentu tak hanya kegiatan keagamaan yang ada di sini, namun juga kegiatan olahraga dan olah seni yang mungkin cocok dengan Quipperian Hindu yang berjiwa seni dan sporty.\r\n\r\nPelayanan Rohani Mahasiswa Katholik\r\nPelayanan Rohani Mahasiswa Katolik, sesuai namanya, adalah UKM yang cocok bagi Quipperian yang beragama Katholik. Di UKM ini, Quipperian bisa mengenal orang-orang yang seagama dengan Quipperian. Didirikannya UKM bertujuan untuk mengenal orang-orang yang seagama dengan Quipperian.\r\n\r\nLembaga Dakwah Kampus Insani\r\nJika Quipperian merupakan seorang Muslim dan sangat tertarik untuk belajar tentang Islam, maka Quipperian wajib masuk dalam Lembaga Dakwah Kampus Insani. Di UKM ini, Quipperian akan diajak untuk mempelajari Islam dengan cara sering diskusi. Selain diskusi, Quipperian juga akan dibimbing untuk mengikuti Latihan Dasar Kepemimpinan (LDK). Latihan ini bertujuan untuk meningkatkan wawasan dan kemampuan kepemimpinan Quipperian.\r\n\r\nPeduli Sosial Universitas Diponegoro\r\nKepedulian akan sesama, menjadi hal yang penting dalam hidup bermasyarakat. Jika Quipperian ingin berpartisipasi dalam kegiatan sosial kampus, maka Quipperian bisa masuk dalam UKM Peduli Sosial Universitas Diponegoro.\r\n\r\nDi sini, Quipperian akan belajar untuk memahami masalah sosial yang dihadapi ada di sekitar. Tak cukup dengan memahami, Quipperian juga akan diajak membangun langkah nyata untuk membantu lingkungan sosial. Kontribusi UKM ini di masyarakat sekitar sudah tidak diragukan lagi,  sehingga UKM Peduli Sosial pernah mendapatkan bantuan dari Kementerian Koperasi RI 2014 dan didanai oleh Dikti pada tahun 2015.\r\n\r\nUKM Bola Voli\r\nJika Quipperian memang berjiwa sporty dan hobi bermain voli, nampaknya Quipperian harus masuk di UKM Bola Voli. UKM ini akan menjadi wadah bagi Quipperian untuk menyalurkan bakat dan bertemu dengan orang-orang yang ahli di bidang voli, sehingga bakat Quipperian akan terus meningkat.\r\n\r\nUKM Bulu Tangkis\r\nApakah Quipperian mengidolakan sosok Taufik Hidayat, Susi Susanti, Tontowi, dan Lilyana Natsir? Keempat tokoh tersebut merupakan atlet bulu tangkis Indonesia. Jika Quipperian memiliki bakat yang sama dengan mereka, Universitas Diponegoro telah menyediakan wadah khusus untuk mahasiswanya, yaitu UKM Bulu Tangkis. Daripada keinginan dan bakat Quipperian menjadi sia-sia, ada baiknya Quipperian mengikuti UKM Bulu Tangkis.\r\n\r\nDi UKM ini, Quipperian tak hanya mendapatkan latihan untuk bermain bulu tangkis, namun juga diberikan kesempatan untuk berkompetisi. UKM Bulu Tangkis  Universitas Diponegoro pernah menjadi Semifinalis di Brawijaya Open 2015 dan Semifinalis Pekan Olahraga Mahasiswa (POM) Rayon 1 di USM 2015.\r\n\r\nUKM Sepak Bola\r\nAdakah di antara Quipperian yang jago bermain bola layaknya Captain Tsubasa? Di Universitas Diponegoro, Quipperian bisa membuktikannya di UKM Sepak Bola. UKM Sepak Bola Universitas Diponegoro berhasil meraih juara I di ajang Rektor Cup 2016 yang diselenggarakan Universitas Muhammadiyah Purwokerto. Ajang ini diikuti oleh peserta se-Pulau Jawa.\r\n\r\nUKM Tenis Meja\r\nJika Quipperian suka bermain tenis meja dan ingin serius jago bermain tenis meja, maka Quipperian bisa masuk ke UKM Tenis Meja. UKM Tenis Meja Universitas Diponegoro berhasil meraih berbagai penghargaan. Pasti Quipperian akan lebih jago deh setelah bergabung dengan UKM Tenis Meja.\r\n\r\nUKM Menembak\r\nIngin merasakan sensasi memegang senjata seperti yang ada di film action? Quipperian harus masuk UKM Menembak! Di sini, Quipperian akan dibimbing agar menjadi penembak jitu, sehingga paham bahwa ilmu tentang menembak itu tidak semudah yang Quipperian lihat.\r\n\r\nUKM Shorinji Kempo Undip\r\nApakah Quipperian gemar bela diri atau sekadar ingin belajar self-defense? Jika iya, mungkin Quipperian harus masuk UKM Kempo Universitas Diponegoro. Tujuan didirikanya Shorinji Kempo Universitas Diponegoro adalah untuk mewadahi minat dan bakat mahasiswa di bidang olahraga Shorinji Kempo, menciptakan atlet-atlet berprestasi, mengamalkan ajaran Kempo bagi masyarakat, serta memberikan senjata untuk membela diri kepada para mahasiswa terhadap bahaya yang setiap saat dapat mengancam keselamatan.\r\n\r\nUKM Karate Inkardo Undip\r\nSelain Kempo, Universitas Diponegoro juga memiliki UKM Karate Inkardo. Sama seperti Kempo, tujuan didirikannya UKM ini adalah untuk mengumpulkan mahasiswa yang memiliki minat dan siap berkompetisi. Setelah masuk UKM ini, Quipperian mungkin bisa sejago Bruce Lee.\r\n\r\nUKM Perisai Diri\r\nTujuan didirikannya UKM Perisai Diri adalah untuk melestarikan budaya silat agar tidak punah, terutama di kalangan pemuda khususnya Perguruan Tinggi, mencetak bibit atlet pencak silat yang mempunyai watak budi pekerti luhur, sebagai wadah kegiatan ekstra bagi mahasiswa dalam mengembangkan minat dan bakat terutama pencak silat, dan meningkatkan kebugaran jasmani maupun rohani. Apabila Quipperian ingin melestarikan budaya dalam negeri dan ingin sehebat Iko Uwais, maka Quipperian harus masuk di UKM Perisai Diri.\r\n\r\nUKM Catur Undip\r\nApakah Quipperian hobi bermain strategi menggunakan catur? Jika iya, maka Quipperian bisa masuk UKM Catur. Di UKM ini, Quipperian akan diajarkan berbagai taktik permainan catur agar tetap juara.\r\n\r\nUKM Bola Basket\r\nApakah Quipperian gemar bermain basket dan mengikuti ekstrakurikuler basket di SMA? Jika iya, Quipperian bisa meneruskan kegiatan tersebut di UKM Bola Basket. UKM ini akan memfasilitasi Quipperian untuk bertemu dengan para senior handal, sehingga Quipperian bisa banyak berlatih dari mereka.\r\n\r\nBeberapa kali berganti pelatih, kini UKM Bola Basket Universitas Diponegoro dilatih oleh Gogor Gubah Nugroho dengan lisensi B. Beliau sudah melatih Universitas Diponegoro selama 8 tahun. Selama beberapa tahun ini, Universitas Diponegoro pernah beberapa kali meraih gelar juara serta melahirkan pemain-pemain hebat yang bermain untuk daerah, seperti PON atau POPNAS.\r\n\r\nUKM Unit Kegiatan Selam 387\r\nApakah Quipperian pernah membayangkan betapa serunya menyelam dan menyaksikan apa yang ada di dalam laut? Jika iya, maka Quipperian harus masuk ke Unit Kegiatan Selam 387. Di sini, Quipperian akan dilatih tentang tata cara menyelam secara aman. Selain berlatih, Quipperian bisa berlibur untuk menikmati keindahan laut di Indonesia.\r\n\r\nUKM Racana Undip\r\nJika Quipperian pernah mengikuti kegiatan pramuka di SMA dan ingin tetap mengikuti Pramuka, maka Quipperian harus masuk Racana. Di sini, Quipperian akan bertemu dengan orang-orang yang memiliki kecintaan yang sama dengan Quipperian.\r\n\r\nKorps Sukarela PMI Unit Undip\r\nApakah Quipperian tertarik dan pernah mengikuti kegiatan PMR di SMA? Nah, tepat sekali, karena Universitas Diponegoro memiliki Korps Sukarela Palang Merah Indonesia Unit Universitas Diponegoro buat Quipperian. Di sini, Quipperian akan bertemu dengan orang-orang yang memiliki kecintaan sama dengan Quipperian.\r\n\r\nResimen Mahasiswa (Menwa) Undip\r\nPernahkah Quipperian bermimpi menjadi tentara? Masuk di Universitas, bukan berarti keinginan Quipperian hilang begitu saja loh. Quipperian bisa menghilangkan penasaran atau sekadar meneruskan passion di dunia tentara dengan cara masuk di Resimen Mahasiswa Universitas Diponegoro.\r\n\r\nDi sini, Quipperian akan dididik untuk disiplin dan memiliki kekuatan mental, karena akan dipersiapkan untuk mempertahankan NKRI sebagai perwujudan Sistem Pertahanan dan Keamanan Rakyat Semesta (Sishankamrata).\r\n\r\nMahasiswa Pecinta Alam (Mapala) Undip\r\nApakah Quipperian hobi naik gunung atau bermain arung jeram? Wapeala Universitas Diponegoro adalah tempat yang tepat bagi Quipperian untuk memuaskan hobi tersebut. Di sini, ada agenda rutin untuk jelajah alam. Tak hanya itu, Quipperian juga akan belajar tentang SAR (Search and Rescue) untuk menolong kawan-kawan Quipperian nanti jika mengalami masalah saat menjelajahi alam.\r\n\r\nPerhimpunan Seni Foto Mahasiswa (Prisma) Undip\r\nDunia fotografi merupakan dunia yang penuh kreativitas. Terlebih, hal tersebut disentuh oleh tangan-tangan orang berintelektualitas tinggi seperti mahasiswa. Saat ini, dunia fotografi sedang berkembang pesat, terutama setelah kemunculan telepon pintar. Dalam skala kecil, teknik ini dibutuhkan saat Quipperian ingin mengunggah hasil jepretan melalui dunia maya. Jika Quipperian tertarik dengan fotografi, maka di sini tempatnya.\r\n\r\nLembaga Pers Mahasiswa Manunggal\r\nJika Quipperian ingin terjun di dunia media, Quipperian harus masuk UKM LPM Manunggal. Di sini, Quipperian akan dilatih untuk menjadi jurnalis, editor, dan profesi lain di antara hiruk-pikuk di dunia media. Hal ini akan berguna untuk melatih kepekaan Quipperian terhadap media.', , '2020-10-20 11:59:12', '2020-10-20 11:59:12', 14);
INSERT INTO `post` (`idpost`, `judul`, `idkategori`, `isipost`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`) VALUES
(44, 'Patung Pangeran Diponegoro', 2, 'Ketika melintas di depan gerbang Universitas Diponegoro (Undip) Semarang, maka akan terlihat sebuah patung besar yang akan menyambut kedatangan setiap orang yang melaluinya.\r\n\r\nMasyarakat sekitar dan kebanyakan mahasiswa Undip mengenal patung tersebut dengan julukan Patung Kuda. Padahal, sejatinya patung tersebut ialah Patung Pangeran Diponegoro yang sedang menaiki kuda &quot;Turangga Seta&quot;.\r\n\r\nGiri Rindra, salah seorang mahasiswa Undip jurusan Arsitektur ini sangat menyayangkan anggapan masyarakat yang sudah terlanjur menjuluki Patung Pangeran Diponegoro dengan julukan Patung Kuda.\r\n\r\n&quot;Aku miris banget melihat kenyataan seolah-olah orang justru lebih menghormati kuda dibandingkan Pangeran Diponegoro. Padahal kan patung itu dibangun sebagai lambang kegagahan Pangeran Diponegoro bukan lambang kegagahan seekor kuda, &quot; tutur mahasiswa 19 tahun tersebut.\r\n\r\nLain Giri lain pula Warsito. Tukang ojek asal Semarang berusia 45 tahun ini menuturkan, memang dari dulu orang orang sudah terbiasa menjuluki patung tersebut dengan julukan patung kuda bukan Patung Pangeran Diponegoro.\r\n\r\nTerkait akan hal ini Rektor Universitas Diponegoro, Prof Sudharto P Hadi pernah menegaskan melalui sambutannya dalam acara wisuda ke 131 Universitas Diponegoro, Semarang.  \r\n\r\n&quot;Ingat bahwa di pertigaan Ngesrep ada Patung Diponegoro naik Kuda. Jangan sampai salah sebut, bahwa itu Patung Kuda. Itu adalah Patung Pangeran Diponegoro. Sebab, patung itu menunjukkan pintu masuk utama menuju kampus Diponegoro tercinta, bukan pintu masuk menuju kampus kuda,&quot; ujarnya lantang. (Ahmad Maulana/mar)\r\n\r\nAhmad Maulana adalah pewarta warga.', , '2020-10-25 06:47:20', '2020-10-25 14:14:28', 14);

